import Nav from '../Nav/Nav';
import ResultDisplay from '../ResultDisplay/ResultDisplay';
import Footer from '../Footer/Footer';
import ResultsTitle from '../ResultsTitle/ResultsTitle';
import {Group, Person} from '../../groupClass.js';


function ResultPage(props) {
   let GroupObject = new Group();
   const [aGroupObject, setGroupObject] = useState(GroupObject);
   const [fromLandingPage, setFromLandinPage] = useState(false);
   const [aJson, setAjson] = useState(null);

   useEffect(() => {
     console.log(props.location.isTrue);
     console.log(props.location.state);
     if (props.location.isTrue) {
       setFromLandinPage(true);
       setAjson(props.location.state);
       console.log(aJson);
       console.log(fromLandingPage);
     } else {
       setGroupObject();
     }
   },[aJson]);




  function saveProject() {
    console.log("SAVE BUTTON CLICKED...");

  }


  return (
      <div className="page-wrapper">
        <header>
          <Nav />
          <ResultsTitle title={"hello"}/>
        </header>
        <main id="entry-container">
          <ResultDisplay />
        </main>
          <Footer
            value="Save"
            text="Save"
            onClick={saveProject()}/>
      </div>
  );

}

export default ResultPage;


